import React from 'react';
import HornedBeast from './HornedBeast';
import beast1Image from './bowling1.jpeg'; 
import beast2Image from './hornedtennis.jpeg'; 

function Gallery() {
  return (
    <div>
      <HornedBeast
        title="The Horned Beast Bowler"
        imageUrl="./bowling1.jpeg"
        description="Horned Beast that loves to bowl."
      />
      <HornedBeast
        title="Beast 2"
        imageUrl="url_of_beast_2"
        description="Description of beast 2"
      />

    </div>
  );
}

export default Gallery;
